import React from 'react';
import {
  Text,
  ScrollView,
  SafeAreaView,
} from 'react-native';
import styled from 'styled-components/native';


export default function LoginScreen() {
  return (
    <SafeAreaView>
      <ScrollView>
        <Text>This is Login screen!</Text>
      </ScrollView>
    </SafeAreaView>
  );
}


const SafeContainer = styled.SafeAreaView`
  width: 100%;
  height: 100%;
`;
